  summary: "\nPlug-in adding the currently logged in windows user, provided that the\nuser is not an anonymous user.\n"
  remarks: "\nExceptions: we don&apos;t care if this fails. Either we&apos;re dependent on this token, \nin which case it will be caught later; or we&apos;re not, and then problems here should not matter\n"
